import getBins from"./standard-bins";import{utcMillisecond,utcSecond,utcMinute,utcHour,utcDay,utcWeek,utcMonth,utcYear}from"../../../fc-utils/src/time-intervals/utc";describe("Standard bins generation test cases",function(){var customBin={year:[1,5],month:[1,2,3],day:[],hour:[],minute:[],second:[],millisecond:[]},stanardBins;it("Standard bins is restricted when custom bin is provied",function(done){stanardBins=getBins(utcYear,utcMonth,utcWeek,utcDay,utcHour,utcMinute,utcSecond,utcMillisecond,customBin);expect(stanardBins.length).toEqual(5);done()});it("Standard bins are as default when custom bin is not provied",function(done){stanardBins=getBins(utcYear,utcMonth,utcWeek,utcDay,utcHour,utcMinute,utcSecond,utcMillisecond,undefined);expect(stanardBins.length).toEqual(55);done()})});